import React from 'react';
import { Grid } from '@material-ui/core';

import Product from './Product/Product';

const products = [
    { id: 1, name: 'Shoes', description: 'Basketball Shoes', price: '$220', image: 'https://favpng.com/png_view/nike-nike-kobe-11-elite-low-kobe-11-low-mamba-day-nike-kobe-11-mens-mens-nike-kobe-11-png/rnG8Mjaz' },
    { id: 2, name: 'Shoes', description: 'Running Shoes', price: '$100', image: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.rackroomshoes.com%2Fp%2Frenew-run-running-shoe%2F621115&psig=AOvVaw0Ngo1VLiHyRVKlAHpTJR3D&ust=1623876270887000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJi25tTAmvECFQAAAAAdAAAAABAF'}, 
];

const Products = () => {
    return (
    <main>
        <Grid container justify="center" spacing={4}>
            {products.map((product) =>(
                <Grid item key ={product.id} xs={12} sm={6} md={4} lg={3}>
                    <Product product={product}/> 
                </Grid>
            ))}
        </Grid>
    </main>
    )
}

export default Products;
